from math import sqrt, ceil

def min_squares(n: int) -> int:
    if n <= 0:
        return -1
    if n <= 3:
        return n
    F = [-1] * (n + 1)
    F[0] = 0
    F[1] = 1
    F[2] = 2
    F[3] = 3
    for i in range(4, n + 1):
        F[i] = i
        for x in range(1, int(sqrt(i)) + 1):
            temp = x * x
            if temp > i:
                break
            F[i] = min(F[i], 1 + F[i - temp])
    return F[n]

